import styled from 'styled-components';

export const Item = styled.li`
    margin-top: 10px;
    margin-bottom: 10px;
    border-radius: 10px;
    display: flex;
    justify-content: space-between;
    align-items: center;
    background-color: pink;
    height: 40px;
    padding-left: 10px;
    padding-right: 10px;

    &:hover {
        background-color: #f2f2f2;
    }
`;

export const ItemContainer = styled.div`
    display: flex;
    align-items: center;
    gap: 10px;
    background-color: purple;
`;
